import React from 'react'

function AppointmentDetail(props) {

  const message = props.message;
  const isOpen = props.isOpen;
  const onClose = props.onClose;

  if (!isOpen){
    return null
  }
  return (
    <div>
      {message}

      <button onClick={onClose}></button>
    </div>
  )
}

export default AppointmentDetail
